import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import {lat1,long1} from './location.js';
var lat,long;


function get(){
  if(lat!=lat1 || long!=long1){
    lat=lat1;
    long=long1;
  return 1;
  }
  else{
    return 0;
  }
}
if(get()){
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
}



